package Lec2;

import java.util.Scanner;

public class Comparison_operator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner s = new Scanner(System.in);
		int x = s.nextInt();
		int y = s.nextInt();
		if(x==y) {
			System.out.println("Yes");
		}
		else {
			System.out.println("No");
		}

	}

}
